import React from 'react'
class Hero extends React.Component {
  render () {
    return (
      <div id='hero' className='section section-hero'>
        <div className='section-hero--copy' data-aos='fade-down'>
          <h1 class='rainbow-text'>Hi, I'm Mary McGinty, UI developer and Digital Designer.</h1>
        </div>
        <div className='section-hero--image' data-aos='fade-up' />
      </div>
    )
  }
}
export default Hero
